import * as React from 'react';
import { CartContext } from '../../Context/cartContext'

export const CartIcon = () => {
    return (
        <CartContext.Consumer>
            <a href='/cart'>
                <i className="material-icons right hide-on-med-and-down">shopping_cart</i>
                {number => <p>{number}</p>}
            </a>
        </CartContext.Consumer>
    );
};
